import React from "react";

import Navbar from "../../components/navbar";
import Body from "../../components/body";

import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";

import withStyles from "./styles";

class Home extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <Grid container>
        <Navbar />
        <Body>
          <div className={classes.container}>
            <div className={classes.introContainer}>
              <div>
                <Typography className={classes.intro}>
                  Hi, my name is
                </Typography>
              </div>
              <div>
                <Typography className={classes.name}>Drew Blincoe</Typography>
              </div>
              <div>
                <Typography className={classes.title}>
                  I am a Software Developer
                </Typography>
              </div>
              <div>
                <Typography className={classes.description}>
                  <p>
                    I am a software developer, based in Evansville, IN. I
                    specialize in building exceptional web applications and
                    forming effecient code. Currently working at{" "}
                    <a
                      href="https://torchlite.com/"
                      target="_blank"
                      className={classes.link}
                    >
                      Torchlite
                    </a>{" "}
                    as a fullstack developer.
                  </p>
                </Typography>
              </div>
            </div>
          </div>
        </Body>
      </Grid>
    );
  }
}

export default withStyles(Home);
